tables.table_schema:
CREATE TABLE measurement_data (
    id INT PRIMARY KEY,
    qubit_id INT,
    measurement_result VARCHAR(10),
    measurement_timestamp TIMESTAMP
);

CREATE TABLE Quantum_Teleportation_Data (
    id INT PRIMARY KEY,
    sender_qubit VARCHAR(255),
    receiver_qubit VARCHAR(255),
    teleportation_date TIMESTAMP
);

CREATE TABLE Quantum_Teleportation_Measurements (
    id INT PRIMARY KEY,
    observer_qubit VARCHAR(255),
    result VARCHAR(255),
    measurement_date TIMESTAMP
);

CREATE TABLE Quantum_Teleportation_Analysis (
    id INT PRIMARY KEY,
    analysis_type VARCHAR(255),
    analysis_result TEXT,
    analysis_date TIMESTAMP
);

CREATE TABLE teleportation_data (
    id SERIAL PRIMARY KEY,
    source_qubit INT,
    destination_qubit INT,
    teleportation_result TEXT
);

CREATE TABLE teleportation_measurements (
    id SERIAL PRIMARY KEY,
    measurement_id INT,
    measurement_result TEXT,
    measurement_time TIMESTAMP
);

CREATE TABLE quantum_states (
    id SERIAL PRIMARY KEY,
    state_name TEXT,
    state_vector TEXT
);

CREATE TABLE teleportation_logs (
    id SERIAL PRIMARY KEY,
    log_time TIMESTAMP,
    log_message TEXT
);

CREATE TABLE teleportation_data (
    id INT PRIMARY KEY,
    quantum_bits INT,
    teleportation_success BOOLEAN
);

CREATE TABLE teleportation_measurements (
    id INT PRIMARY KEY,
    measurement_id INT,
    measurement_result VARCHAR(255),
    FOREIGN KEY (measurement_id) REFERENCES teleportation_data(id)
);

CREATE TABLE teleportation_partners (
    id INT PRIMARY KEY,
    partner_name VARCHAR(255),
    partner_contact INT
);

CREATE TABLE teleportation_gate (
    id INT PRIMARY KEY,
    gate_name VARCHAR(255),
    gate_circuit VARCHAR(255)
);

CREATE TABLE teleportation_analysis (
    id INT PRIMARY KEY,
    analysis_id INT,
    analysis_result VARCHAR(255),
    FOREIGN KEY (analysis_id) REFERENCES teleportation_data(id)
);
